//getData
totalTechnicians.textContent = dummyData.length;
let current_page = 1;
let recordPerPage = 10;

let pageNo  = function() {
    return Math.ceil(dummyData.length / recordPerPage);  
};

let pageNumbers = function() {
    
    for (let i = 0; i < pageNo(); i++){
        let a = document.createElement('a');
        a.setAttribute('href', '#');
        a.setAttribute('class', 'bg-white border-gray-300 text-gray-500 hover:bg-gray-50 relative inline-flex items-center px-4 py-2 border text-sm font-medium clickPageNumber');
        a.textContent = i + 1;
        let pageNumber = document.getElementById('page_number');
        pageNumber.appendChild(a);
    }

}

let changePage = function(page){
    if (page < 1){
        page = 1;
    }
    if (page >(pageNo() - 1)){
        page = pageNo();
    }

    tableBody = document.getElementById('tableBody');
    tableBody.innerHTML = "";
    console.log(tableBody)

    for (let j = (page - 1) * recordPerPage; j < (page * recordPerPage) && j < dummyData.length; j++){
        let tr = document.createElement('tr');
        tr.setAttribute('class', 'table-border bg-indigo-200');
        let td = document.createElement('td');
        td.setAttribute('class', 'table-border rounded-l-lg');
        td.innerHTML = j + 1;

        let td1 = document.createElement('td');
        let img = document.createElement('img');
        img.setAttribute('src', dummyData[j].image);
        img.setAttribute('class', 'rounded-full h-12 w-12 object-cover')
        td1.setAttribute('class', 'table-border');
        td1.appendChild(img);

        let td2 = document.createElement('td');
        td2.setAttribute('class', 'table-border');
        td2.innerHTML = dummyData[j].fullname;

        let td3 = document.createElement('td');
        td3.setAttribute('class', 'table-border');
        td3.innerHTML = dummyData[j].technicianID;

        let td4 = document.createElement('td');
        td4.setAttribute('class', 'table-border');
        td4.innerHTML = dummyData[j].speciality;

        let td5 = document.createElement('td');
        td5.setAttribute('class', 'table-border');
        td5.innerHTML = dummyData[j].country;

        let td6 = document.createElement('td');
        td6.setAttribute('class', 'table-border rounded-r-lg');
        td6.innerHTML = dummyData[j].date

        tr.appendChild(td);
        tr.appendChild(td1);
        tr.appendChild(td2);
        tr.appendChild(td3);
        tr.appendChild(td4);
        tr.appendChild(td5);
        tr.appendChild(td6);

        tableBody.appendChild(tr);
    }
}

let clickPage = function() {
    document.addEventListener('click', function(e) {
        if(e.target.nodeName == "A" && e.target.classList.contains("clickPageNumber")){
            current_page = e.target.textContent;
            changePage(current_page);
        }
    });
}

let prevPage = function() {
    if(current_page > 1) {
        current_page--;
        changePage(current_page);
    }
}

let nextPage = function() {
    if(current_page < pageNo()) {
        current_page++;
        changePage(current_page);
    } 
}

let callFunc = function(){
    changePage(1);
    pageNumbers();
    clickPage()
}

callFunc()
